import React from 'react'

const CommentCard = ({comment}) => {
    return (
        <div className="comment-card">
            <p className="comment-card-user">{comment.user.name}</p>
            <p className="comment-card-comment">{comment.comment}</p>
        </div>
    )
}

export default CommentCard
